import React from 'react';
import ReactDOM from 'react-dom';
import App from './App';
import {Provider} from 'react-redux';

export const configureStore = 

ReactDOM.render(
    <Provider store={configureStore}>
        <App/>
    </Provider>
    ,document.querySelector('#root')
);
